import React from "react";
import UsersList from "../components/UsersList";

const Users = () => {
  const USERS = [
    {
      id: "u1",
      name: "Mario",
      image: `https://picsum.photos/id/237/200/300`,
      plaves: 3,
    },
  ];
  return <UsersList items={USERS} />;
};

export default Users;
